import{_ as e,o as t,c as a,O as n}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 3.2-5145.1 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5145.1.md","filePath":"vacode/3.2-5145.1.md"}'),i={name:"vacode/3.2-5145.1.md"},o=n('<h1 id="§-3-2-5145-1-definitions" tabindex="-1">§ 3.2-5145.1 Definitions. <a class="header-anchor" href="#§-3-2-5145-1-definitions" aria-label="Permalink to &quot;§ 3.2-5145.1 Definitions.&quot;">​</a></h1><p>As used in this article, unless the context requires a different meaning:</p><p>&quot;Food&quot; means any article that is intended for human consumption and introduction into commerce, whether the article is simple, mixed, or compound, and all substances or ingredients used in the preparation thereof. &quot;Food&quot; does not mean drug as defined in § <a href="/vacode/54.1-3401/">54.1-3401</a>.</p><p>&quot;Industrial hemp extract&quot; means an extract (i) of a Cannabis sativa plant that has a concentration of tetrahydrocannabinol that is no greater than that allowed for hemp by federal law and (ii) that is intended for human consumption.</p><p>2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0659" target="_blank" rel="noreferrer">659</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0660" target="_blank" rel="noreferrer">660</a>.</p>',5),r=[o];function s(d,c,l,h,p,_){return t(),a("div",null,r)}const m=e(i,[["render",s]]);export{u as __pageData,m as default};
